import React from "react";
import "./DayCard.css"

const DayCard = () => {
    return(
        <div className="card">
            <h3> Monday </h3>
            <p>Aug 11</p>
            <img src="http://openweathermap.org/img/wn/10d@2x.png" alt="weatherIcon" />
            <h3>Fahrenheit</h3>
            <p>Cloudy</p>
        </div>
    )
};

export default DayCard;
